import React from 'react';
import './css/CollectionsPage.css';

class CollectionsPage extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            collections: []
        }

        this.handleDelete = async( idToDelete ) => {
            await this.repository.deleteById( idToDelete );
            this.setState( { images: await this.repository.findAll('photos') } );
          };
    }

    render() {
        return (
            <div class="container">
                <div id="photo-wall">
                    <ul>
                    {this.state.collections.map((imgcontent) => {
                    return (
                        <li>
                        <div class="post">
